import React from 'react';
import logo from './logo.svg';
import './App.css';
const firstName = 'Khalid';
const lastName = 'Almuqbil';
const project = 'Hand Written Arabic Digits';
const tools = 'Python Kears TensorFlow Jupetor Notebook Flask Jqure Numpy Pandas Matplotlib and much more';

const getFullName =(firstName , lastName) => {firstName + '' + lastName};
function App() {
  return (
    <div className="App">
      <h1>{getFullName}</h1>
      <h3>Welcom to my blog</h3>
      <h4>{project}</h4>
      <p>Tools :{tools}</p>
    </div>
  );
}

export default App;
